function searchXML() {
  var searchString = $("#input").val();
  
  $("#norman-results").text("");
  Norman.forEach(function(entry) {
    if (entry.toLowerCase().indexOf(searchString.toLowerCase()) > -1) {
      $("#norman-results").append(entry + "<br><br>")
	}
	});
  
  $("#ajiu-results").text("");
  Ajiu.forEach(function(entry) {
    if (entry.toLowerCase().indexOf(searchString.toLowerCase()) > -1) {
      $("#ajiu-results").append(entry + "<br><br>")
    }	
  });
    
	$("#pent-results").text("");
  pent.forEach(function(entry) {
    if (entry.toLowerCase().indexOf(searchString.toLowerCase()) > -1) {
      $("#pent-results").append(entry + "<br><br>")
    }
  });
  
    document.getElementById("search-nav").style.display = "block";

};

function normanTab() {
document.getElementById("ajiu-results").style.display = "none";
document.getElementById("pent-results").style.display = "none";
document.getElementById("norman-results").style.display = "block";	
};

